import { useLoaderData, Outlet } from "react-router-dom";
import DeleteChecklist from "../components";
import { useState } from "react";

export default function Admin() {
  const data = useLoaderData();
  //   const [selected, setSelected] = useState();

  var items;
  if (data[0].title) {
    items = data.map((review) => {
      return review.title;
    });
  }
  return (
    <div className="container">
      <div>
        <DeleteChecklist
          title={"Names"}
          items={items}
          color={"black"}
          onClick={(selectedItems) => {
            alert(`You selected: ${selectedItems}`);
          }}
        ></DeleteChecklist>
        <p>
          Description: this is a checkbox list that lists out names in the color
          black. When this submit button is clicked, an alert with the selected
          items is shown.
        </p>
      </div>
    </div>
  );
}
